import React, { Component } from 'react';
import LuckyDrawForm from './LuckyDrawForm';
import frontPage from './frontPage';
import './App.css';
import { Route, Router } from 'react-router-dom';
function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route
          path ="/"
          element={<frontPage />}
        />
        <Route
          path='/Lucky'
          element={<LuckyDrawForm />}
        />
      </Routes>
    </Router>
    </>
  );
}

export default App;
